
"use strict";
// This file is intentionally blank. It will be overwritten by next-pwa.
// This is the service worker that will be generated by next-pwa.
// It will handle caching and push notifications.

self.addEventListener("push", function (event) {
  const data = event.data?.json() ?? {};
  event.waitUntil(
    self.registration.showNotification(data.title || "PrEPy", {
      body: data.body || "Notification de PrEPy",
      icon: data.icon || "/icon-192x192.png",
      ...data,
    })
  );
});

    